export class Goal {
    constructor(name, id, status, color){
        this.name = name;
        this.id = id;
        this.status = status;
        this.color = color;
    }
}

export function readGoals(project){
    return project.goals ? project.goals.map((goal, id) => {
        var colorId = goal.color && (project.goalColors.find(color => color.color === goal.color.color))
        return (new Goal(goal.name, id, goal.status, goal.colorId));
    }) : [];
}
